        <div>
            <Card
                url="http://sub.mersion.cc/m308/m308_2019D.html"
                name="Lil Kelv"
                phoneNum="911"
                email="lilkelv@gmail.gov"
            />
            <Card />
        </div>
    );
}

export default CardApp;
